import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (<React.Fragment>
				<div className="App" key="item1">
        <h1>Hello, world!</h1>
      </div>,
			<p key="item2">Another bit of content</p>
		</React.Fragment>)
  }
}

export default App;
